        // Bestellungen der angefragten Seite "ausschneiden"
        $orders = array_slice($ordersAfterModifiedSince, ($page - 1) * $pageSize, $pageSize);

        // Ergebnis zurÃ¼ckgeben
        return new PagedData($orders, count($ordersAfterModifiedSince));
    }

